package com.imancha.test;

public class octalToDecimal {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int six = 06;
		int seven = 07;
		int eight = 010;
		int nine = 011;
		
		System.out.println("Octal 06  = "+six+" Decimal");
		System.out.println("Octal 07  = "+seven+" Decimal");
		System.out.println("Octal 010 = "+eight+" Decimal");
		System.out.println("Octal 011 = "+nine+" Decimal");
	}

}
